import { Route } from 'react-router-dom';
import AccountPage from '../pages/user/AccountPage';
import Blog from '../pages/user/Blog';
import Explore from '../pages/user/Explore';
import Home from '../pages/user/Home';
import PostRecipe from '../pages/user/PostRecipe';
import Profile from '../pages/user/Profile';
import RecipeCard from '../pages/user/RecipeCard';
import RecipeDetail from '../pages/user/RecipeDetail';
import SmartChef from '../pages/user/SmartChef';
import Layout from '../Layouts/UserLayout/Layout';
import Footer from '../Layouts/UserLayout/Footer';
import Navigation from '../Layouts/UserLayout/Navigation';



const UserRoutes = () => {
	
        <Route element={<Layout />}>
          <Route index element={<Home />} />
          <Route path="explore" element={<Explore />} />
          <Route path="blog" element={<Blog />} />
          <Route path="smart-chef" element={<SmartChef />} />
          <Route path="post" element={<PostRecipe />} />
          <Route path="profile" element={<Profile />} />
          <Route path="recipe/:id" element={<RecipeDetail />} />
          <Route path="account" element={<AccountPage />} />
        </Route>
      
};

export default UserRoutes;
